INSERT INTO categorie
VALUES ('00001', 'Processeurs','Un processeur (ou unité centrale de calcul, UCC ; en anglais central processing unit, CPU) est un composant présent dans de nombreux dispositifs électroniques qui exécute les instructions machine des programmes informatiques.');
INSERT INTO categorie
VALUES ('00002', 'Stockage mémoire','En informatique, la mémoire est un dispositif électronique numérique qui sert à stocker des données.');
INSERT INTO categorie
VALUES ('00003', 'Cartes graphiques','Une carte graphique ou carte vidéo (anciennement, par abus de langage, une carte VGA), ou encore un adaptateur graphique, est un périphérique graphique ou carte d extension d’ordinateur dont le rôle est de produire une image affichable sur un écran.');
INSERT INTO categorie
VALUES ('00004', 'Cartes meres','La carte mère est le circuit imprimé qui supporte la plupart des composants et des connecteurs nécessaires au fonctionnement d un compatible PC.');
INSERT INTO categorie
VALUES ('00005', 'Ventilateurs','Un ventilateur d ordinateur est un ventilateur installé à l''intérieur d''un ordinateur ou fixé à celui-ci et utilisé pour en refroidir activement le boîtier.');

